await robot.userRequest('访客服务');
const visitorName = await robot.ask('您好，请问您的名字是？');

if(visitorName === '张师傅'){
    await robot.speak('您好，张师傅，请跟随我去会议室。');
    await robot.goto('会议室');
}else{
    await robot.speak('抱歉，您没有进入权限，请联系工作人员。');
}

